import logo from './logo.svg';
import './App.css';
import { Button } from '@material-ui/core';
import PropTypes from 'prop-types';
import Example from './example';
import ActionLink from './ActionLink';
import App from './App';
//import Examplen from './examplen';
import Butn1 from './but';


function DopComponent({ name1, incrementCount, helloText, count, isAdmin }) {

    return (
        <div className="App">
            <header className="App-header">
                <img src={logo} className="App-logo" alt="logo" />
                <p>
                    {helloText}
                </p>
                <p>
                    {name1}
                </p>
                <a
                    className="App-link"

                    target="_blank"
                    rel="noopener noreferrer"
                >
                    Learn React
                </a>
                <div className="but">
                    <Button variant="outlined" color="primary" onClick={ActionLink}> Просмотр видео </Button>
                </div>
                <div className="but1">
                    {count}

                </div>
            </header>
             <div>
                <Example />
            </div> 
        </div>
    );
}


DopComponent.propTypes = {

    count: PropTypes.number.isRequired,

    helloText: PropTypes.string.isRequired,
    isAdmin: PropTypes.bool.isRequired
}



export default DopComponent;
